class ExamProcessor:
    def __init__(self, marker_dict=aruco.DICT_4X4_50):
        self.template = cv2.imdecode(np.frombuffer(EXAM4CORNER, np.uint8), cv2.IMREAD_COLOR)
        self.aruco_dict = aruco.getPredefinedDictionary(marker_dict)
        self.aruco_params = aruco.DetectorParameters()
        self.questions = None
        self.cvqr = cv2.QRCodeDetector()
        self.aiqr = QReader()
   
    def ocv_qr(self, img_in):
        crop = img_in[0:275,850:1100]
        retval, decoded_info, points, straight_qrcode = self.cvqr.detectAndDecodeMulti(crop)
        if not retval:
            return None
        return decoded_info[0]
    
    def zbar_qr(self, img_in):
        crop = img_in[0:275,850:1100]
        data_objects = pyzbar.pyzbar.decode(crop)
        if not data_objects:
            return None      
        return data_objects[0].data.decode('utf-8')
    
    def ai_qr(self, img_in):
        data = self.aiqr.detect_and_decode(image=img_in)
        if not data:
            return None
        return data[0]

    def get_gift(self, examid):
        try:
            get_gift = requests.get(f"https://127.0.0.1:7045/api/Exam/exams/{examid}", timeout=5, verify=False)
            get_gift.raise_for_status()
            return get_gift.json()
        except requests.RequestException as err:
            raise Exception(f"Error getting exam from server, {str(err)}")

    def detect_markers(self, img):
        gray = cv2.cvtColor(img, cv2.COLOR_BGR2GRAY)
        detector = aruco.ArucoDetector(self.aruco_dict, self.aruco_params)
        corners, ids, _ = detector.detectMarkers(gray)
        if ids is None or len(ids) < 3:
            raise Exception("Not enough fiducial markers detected.")
        return {int(id_[0]): np.mean(c.reshape(-1, 2), axis=0).astype(np.float32)
                for id_, c in zip(ids, corners)}

    def compute_transform(self, img_pts, ref_pts):
        if len(img_pts) == 3:
            return cv2.getAffineTransform(np.array(img_pts), np.array(ref_pts))
        H, _ = cv2.findHomography(np.array(img_pts), np.array(ref_pts))
        return H

    def warp_to_reference(self, img):
        src = self.detect_markers(img)
        dst = self.detect_markers(self.template)
        common = sorted(set(src) & set(dst))
        img_pts = [src[mid] for mid in common]
        ref_pts = [dst[mid] for mid in common]
        M = self.compute_transform(img_pts, ref_pts)
        h, w = self.template.shape[:2]
        if M.shape == (2, 3):
            warped = cv2.warpAffine(img, M, (w, h))
        else:
            warped = cv2.warpPerspective(img, M, (w, h))
        return warped

    def detect_answers(self, warped, threshold=0.5):
        gray = cv2.cvtColor(warped, cv2.COLOR_BGR2GRAY)
        _, bin_img = cv2.threshold(gray, 0, 255,cv2.THRESH_BINARY_INV + cv2.THRESH_OTSU)
        kernel = cv2.getStructuringElement(cv2.MORPH_RECT, (5, 5))
        bin_img = cv2.morphologyEx(bin_img, cv2.MORPH_CLOSE, kernel, iterations=2)
        
        markers = self.detect_markers(warped)
        xs = [pt[0] for pt in markers.values()]
        ys = [pt[1] for pt in markers.values()]
        x1, x2 = int(min(xs)), int(max(xs))
        ys_sorted = sorted(ys)
        y1 = int(ys_sorted[1] + 0.1 * warped.shape[0])
        y2 = int(warped.shape[0] - 0.1 * warped.shape[0])
        region = bin_img[y1-50:y2, x1:x2]           #TODO: split page, double column #magic numbers NEED more testing, test13 has it.

        """cv2.imshow("wtf", region)
        cv2.waitKey(0)"""

        contours, _ = cv2.findContours(region, cv2.RETR_EXTERNAL, cv2.CHAIN_APPROX_SIMPLE)
        boxes = []
        for cnt in contours:
            peri = cv2.arcLength(cnt, True)
            approx = cv2.approxPolyDP(cnt, 0.02 * peri, True)
            if len(approx) <= 6:
                bx, by, bw, bh = cv2.boundingRect(approx)
                x, y = bx + x1, by + y1 - 50            #magic numbers NEED more testing
                ar = bw / float(bh)
                area = cv2.contourArea(cnt)
                #print(area)
                if 0.6 <= ar <= 1.4 and 200 < area < 1000:
                    boxes.append((x, y, bw, bh))
        boxes.sort(key=lambda b: (b[1], b[0]))

        """#WRITE TO IMG START
        annotated = warped.copy()
        for mid, pt in markers.items():
            cv2.circle(annotated, (int(pt[0]), int(pt[1])), 10, (0, 0, 255), -1)
            cv2.putText(annotated, str(mid), (int(pt[0]) + 12, int(pt[1]) + 6),
                        cv2.FONT_HERSHEY_SIMPLEX, 1, (0, 0, 255), 2)
        for (x, y, bw, bh) in boxes:
            cv2.rectangle(annotated, (x, y), (x + bw, y + bh), (0, 255, 0), 2)
        cv2.imwrite('annotated_boxes.png', annotated)
        #WRITE TO IMG END"""

        #Boxes split to rows
        rows = []
        if boxes:
            current = [boxes[0]]
            for b in boxes[1:]:
                if abs(b[1] - current[-1][1]) < current[-1][3] * 0.6:
                    current.append(b)
                else:
                    rows.append(current)
                    current = [b]
            rows.append(current)

        selections = {}
        for qi, row in enumerate(rows):
            row.sort(key=lambda b: b[0])
            sel = []
            for oi, (x, y, bw, bh) in enumerate(row):
                pad = int(0.1 * bw)
                roi = bin_img[y+pad:y+bh-pad, x+pad:x+bw-pad]
                if roi.size > 0 and cv2.countNonZero(roi) / roi.size > threshold:
                    sel.append(oi)
            selections[qi] = sel
        return selections

    def grade(self, selections):
        report = []
        for idx, q in enumerate(self.questions):
            correct = []
            ans_obj = getattr(q, 'answer', None)
            opts = []
            if ans_obj:
                for attr in dir(ans_obj):
                    val = getattr(ans_obj, attr)
                    if isinstance(val, list):
                        opts = val
                        for idy, opt in enumerate(opts):

                            if opt.percentage > 0.0:
                                correct.append(idy)
                        
            student = selections.get(idx, [])
            report.append({'question': q.text,'correct': correct,'student': student,'is_correct': set(correct)==set(student)})
        
        correct = len([x for x in report if x["is_correct"]])
        
        return {"CorrectDB": correct, "QuestionDB": len(report) ,"Report":report}

    def process(self, imgdata):
        img = cv2.imdecode(np.frombuffer(imgdata, np.uint8), cv2.IMREAD_COLOR)
        warped = self.warp_to_reference(img)

        qr_data = self.ocv_qr(warped)
        
        if not qr_data:
            qr_data = self.zbar_qr(warped)

        if not qr_data:
            qr_data = self.ai_qr(warped)
        
        if not qr_data:
            raise Exception("No QR code detected")

        #print(qr_data) #examadmin;123;5608A46  "examId": exam_id, "examinorId": examiner_id, "neptunCode": neptun 

        #qr_data = "5608A46;1A2365;DDI534"
        qr_data = qr_data.split(";")

        if type(qr_data) != list or len(qr_data) < 3:
            raise Exception("Error in QR code data")
        
        examid = int(qr_data[1])
        examiner_id = qr_data[0]
        neptuncode = qr_data[2]

        #For testing only
        """examid = 1 #TODO: ideiglenes
        examiner_id = "string#"""

        gift_json = self.get_gift(examid)
        gift_data = gift_json["questionnaire"]["giftFile"]

        gift_obj = parser.parse(gift_data)
        if not gift_obj:
            raise Exception("Error in exam parsing")
        
        self.questions = gift_obj.questions[1:]
        selections = self.detect_answers(warped, 0.1) 
        graded = self.grade(selections)
        return {'userUsername': examiner_id, "examId": examid, "examineeNeptunCode": neptuncode, "exam": graded } #"questionDb": graded["QuestionDB"] ,'correctAnswers': graded["CorrectDB"]

